class Solution {
public:
    int rec(int ind,string &s,set<string>&st,vector<int>&dp)
    {
        if (ind==s.size()) return 0;
        if (dp[ind]!=-1) return dp[ind];
        int ans=s.size()-ind;
        for (int i=ind;i<s.size();i++)
        {
           string temp=s.substr(ind,i-ind+1);
           if (st.find(temp)!=st.end())
           {
              ans=min(ans,rec(i+1,s,st,dp));
           }
        }
        ans=min(ans,rec(ind+1,s,st,dp)); 
        return dp[ind]=ans;
    }
    int minExtraChar(string s, vector<string>& dictionary) 
    {
        set<string>st;
        int n=s.size();
        vector<int>dp(n+1,-1);
        for (auto it:dictionary)
        {
            st.insert(it);
        }
        return rec(0,s,st,dp);
    }
};
```
In the original code, the for loop is iterating from `ind` to `s.size()`, but this is causing the function to add a substring of length `s.size()-ind` to the set of substrings for every substring that starts at `ind`. If `s.size()-ind` is included as an extra character, it will be included in the minimum. To avoid this, the loop should iterate from `ind` to `s.size()-1`.
Secondly, the function `rec` shouldn't return `s.size()-ind` when `ind` equals to `s.size()`, but should return `0` instead.
Lastly, the `dp` array should be of size `n+1` because indexes from `0` to `n-1` are used to represent substrings ending at index `n-1`. The index `n` is used to represent the empty string at the end of `s`. This is because the start index of a substring is inclusive, so the end index of a substring should be inclusive. 
